import { FETCH_TODOS_1 } from "../action_types";

const initialState = {
   loading: true,
   todos: [],
};

const todos_1_reducer = (state = initialState, action) => {
   switch (action.type) {
      case FETCH_TODOS_1:
         // const todos = fetchTodos_1(state);
         console.log(todos);
         return { ...state, loading: false, todos };
      default:
         return state;
   }
};

export default todos_1_reducer;
